import { BrowserRouter, Route, Switch } from "react-router-dom";
import HomePage from "./HomePage";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter basename="/rafael fernandez">
      <Switch>
        <Route exact path="/" component={HomePage} />
        {/* Other routes */}
      </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
